INSERT INTO `service_list` (`Sl_No`, `Id`, `Name`, `Service_Type`, `Description`, `Details`, `Features`, `Specification`, `Order_By`, `Total_Count`, `Total_Amount`, `Temp_Count`, `Recycle_Bin`, `Thumbnail`, `updated_at`, `created_at`) VALUES
(1, 'DCAC001', 'Aadhaar Card', 'Public', 'Aadhaar number is a 12-digit random number issued by the UIDAI (“Authority”) to the residents of India after satisfying the verification process laid down by the Authority. ', 'Aadhaar number is verifiable in an online, cost-effective way. It is unique and robust enough to eliminate duplicates and fake identities and may be used as a basis/primary identifier to roll out several Government welfare schemes and programmes for effective service delivery thereby promoting transparency and good governance. This is the only program of its kind globally, wherein a state-of-the-art digital and online Id is being provided free of cost at such a large scale to people, and has the potential to change the way service delivery functions in the country.', 'Uniqueness\nThis is achieved through the process of demographic and biometric de-duplication. The de-duplication process compares the resident’s demographic and biometric information, collected during the process of enrolment, with the records in the UIDAI database to verify if the resident is already in the database or not. An individual needs to enrol for Aadhaar only once and after de-duplication only one Aadhaar shall be generated. In case, the resident enrols more than once, the subsequent enrolments will be rejected.\n\nPortability\nAadhaar gives nationwide portability as it can be authenticated anywhere on-line. This is critical as millions of Indians migrate from one state to another or from rural area to urban centres etc.\n\nRandom number\nAadhaar number is a random number devoid of any intelligence. Person willing to enrol has to provide minimal demographic along with biometric information during the enrolment process. The Aadhaar enrolment process does not capture details like caste, religion, income, health, geography, etc.', 'Aadhar Updates as Follows:\r\n1. Name \r\n2. Father Name \r\n3. Address\r\n4.Gender\r\n5. DOB\r\n\r\nUsing Valid Proof ..', 'A', 71, 18820, 13, 'No', 'storage/app/Department/Thumbnail/aadhaar.png', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(6, 'DCAP006', 'Agreement Papers', 'Public', 'No Descrtiotion Available for this Product', '', '', '', 'C', 77, 14535, 13, 'No', 'storage/app/Department/Thumbnail/agreement.png', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(5, 'DCAPL005', 'APL Ration Card', 'Public', 'No Descrtiotion Available for this Product', '', '', '', 'B', 1, 500, 0, 'No', 'storage/app/Service_Icons/APL Ration Card', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(9, 'DCBA009', 'SBI Kiosk', 'Public', 'A bank is a financial institution licensed to receive deposits and make loans. Banks may also provide financial services.', 'KEY TAKEAWAYS\nA bank is a financial institution licensed to receive deposits and make loans.\nThere are several types of banks including retail, commercial, and investment banks.\nIn most countries, banks are regulated by the national government or central bank.', 'We Provide State SBI bank Services along with Kotak and Canara Bank Account Opening Facility', '', 'A', 0, 0, 0, 'No', 'storage/app/Service_Icons/SBI Kiosk1633492889', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(12, 'DCBC012', 'Birth Certificate', 'Public', 'A birth certificate is a vital record that documents the birth of a person. The term \"birth certificate\" can refer to original document', ' Depending on the jurisdiction, a record of birth might or might not contain verification of the event by such as a midwife or doctor.\n\nThe United Nations Sustainable Development Goal 17, an integral part of the 2030 Agenda, has a target to increase the timely availability of data regarding age, gender, race, ethnicity, and other relevant characteristics which documents like a birth certificate has the capacity to provide.[1]', '', '', 'A', 0, 0, 0, 'No', 'storage/app/Service_Icons/Birth Certificate1633493490', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(4, 'DCBPL004', 'BPL Ration Card', 'Public', 'No Descrtiotion Available for this Product', '', '', '', 'B', 23, 8942, 15, 'No', 'storage/app/Department/Thumbnail/sample.png', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(8, 'DCCI008', 'Caste & Income', 'Public', 'Caste Certificate that help you to get your reservation in government scholarships and help to study higher with your Caste', 'Know your Caste and get your Caste certificate to avail the various government reservations under state and central government schemes.', 'We at Digital Cyber Pvt Ltd, help common people to get these certificates with hassle free services and with in limited period of time', 'Genera & Tatkal Services Available to get your Certificate,', 'A', 26, 19260, 1, 'No', 'storage/app/Service_Icons/Caste & Income1633493163', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(19, 'DCCV001', 'Covid-19', 'Public', 'COVID-19\nCOVID-19 is the disease caused by SARS-CoV-2, the coronavirus that emerged in December 2019.\nCOVID-19 can be severe, and has caused millions ', 'COVID-19 vaccines have been authorized for emergency use by the U.S. Food and Drug Administration, and vaccination programs are in progress across the U.S. and in many parts of the world.\nPrevention involves physical distancing, mask-wearing, hand hygiene and staying away from others if you feel sick.', 'How does the coronavirus spread?\n\nAs of now, researchers know that the coronavirus is spread through droplets and virus particles released into the air when an infected person breathes, talks, laughs, sings, coughs or sneezes. Larger droplets may fall to the ground in a few seconds, but tiny infectious particles can linger in the air and accumulate in indoor places, especially where many people are gathered and there is poor ventilation. This is why mask-wearing, hand hygiene and physical distancing are essential to preventing COVID-19.', 'How did the coronavirus start?\nThe first case of COVID-19 was reported Dec. 1, 2019, and the cause was a then-new coronavirus later named SARS-CoV-2. SARS-CoV-2 may have originated in an animal and changed (mutated) so it could cause illness in humans. In the past, several infectious disease outbreaks have been traced to viruses originating in birds, pigs, bats and other animals that mutated to become dangerous to humans. Research continues, and more study may reveal how and why the coronavirus evolved to cause pandemic disease.', 'B', 0, 0, 0, 'No', 'storage/app/Service_Icons/Covid-191633493067', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(7, 'DCEC007', 'Election Card', 'Public', 'Voter ID, also known as EPIC (Electors Photo Identity Card) is a photo identity card issued by the Election Commission of India.', 'The purpose of voter ID is to serve as identity proof for voters, increase efficiency and prevent impersonation and fraud during free Democracy', 'A unique Serial number\r\nPhotograph of the cardholder\r\nA hologram containing the respective state/national symbol\r\nName of cardholder\r\nfatherâ€™s Name', 'Gender\r\nCard holderâ€™s\r\nCard holderâ€™s date of Birth\r\nThe card holderâ€™s residential address and signature of the issuing authority', 'B', 677, 33100, 34, 'No', 'storage/app/Department/Thumbnail/election.jpg', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(18, 'DCIMA001', 'IMA Claims', 'Public', 'No Descrtiotion Available for this Product', '', '', '', 'D', 0, 0, 0, 'No', 'storage/app/Department/Thumbnail/sample.png', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(15, 'DCOP015', 'Online Applications', 'Public', 'No Descrtiotion Available for this Product', '', '', '', 'C', 0, 0, 0, 'No', 'storage/app/Department/Thumbnail/sample.png', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(2, 'DCPC002', 'Pan Card', 'Public', 'PAN, or permanent account number, is a unique 10-digit alphanumeric identity allotted to each taxpayer by the Income Tax Department.', 'Anybody who earns a taxable income in India, including foreign nationals who pay taxes here\r\nAnybody who runs a business.', 'WHY GET A PAN NUMBER?\r\nFor payment of direct taxes\r\nTo file income tax returns\r\nTo avoid deduction of tax at higher rate than due', 'To enter into specific transaction such as:\r\n(a) Sale or purchase of immovable property valued at Rs 5 lakh or more\r\n(b) Sale or purchase of a vehicle', 'A', 272, 75749, 13, 'No', 'storage/app/Service_Icons/Pan Card1633492847', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(3, 'DCPP003', 'Passport', 'Public', 'An Indian passport is issued by the Indian Ministry of External Affairs to Indian citizens for the purpose of international travel.', 'The Passport Seva (Passport Service) unit of the Consular, Passport & Visa (CPV) Division of the Ministry of External Affairs functions as the central passport organisation, and is responsible for issuing Indian passports on demand to all eligible Indian citizens. Indian passports are issued at 93 passport offices located across India and at 197 Indian diplomatic missions abroad', 'Types of passport\n\n3 types of Indian Passport\n  Ordinary Passport (Dark Blue cover) is issued to ordinary citizens for ordinary travel, such as for vacation, study and business trips (36 or 60 pages). It is a \"Type P\" passport, where P stands for Personal.\n  Official Passport (White cover) is issued to individuals representing the Indian government on official business. It is a \"Type S\" passport, S stands for Service.\n  Diplomatic Passport (Maroon cover) is issued to Indian diplomats, Members of Parliament, members of the Union Council of Ministers, certain high-ranking government officials and diplomatic couriers. Upon request, it may also be issued to high-ranking state-level officials travelling on official business. It is a \"Type D\" passport, with D standing for Diplomatic.', 'Tatkaal and SVP\nTatkaal Passports (for urgent needs),[11] and Short Validity Passport (SVP)[12] are also available and these are generally considered Ordinary Passports once issued.', 'A', 8, 17700, 1, 'No', 'storage/app/Service_Icons/Passport1633493330', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(11, 'DCSBI011', 'SBI Transactions', 'Private', 'No Descrtiotion Available for this Product', '', '', '', 'z', 0, 0, 0, 'No', 'storage/app/Department/Thumbnail/sample.png', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(14, 'DCSC014', 'Scholarships', 'Public', 'No Descrtiotion Available for this Product', '', '', '', 'B', 4, 700, 1, 'No', 'storage/app/Department/Thumbnail/sample.png', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(10, 'DCTR010', 'Train Reservation', 'Public', 'No Descrtiotion Available for this Product', '', '', '', 'B', 71, 31150, 47, 'No', 'storage/app/Department/Thumbnail/sample.png', '0000-00-00 00:00:00', '0000-00-00 00:00:00'),
(13, 'DCVI013', 'Vehicle Insurance', 'Public', 'Motor vehicle insurance law in India is governed by the Motor Vehicles Act, Insurance Act and aspects of insurance contracts governed by the Indian', 'In many jurisdictions, it is compulsory to have vehicle insurance before using or keeping a motor vehicle on public roads.', 'Documents Required to renew Car Insurance Policy are', '1. RC Card\r\nPrevious Insurance Copy', 'B', 0, 0, 0, 'No', 'storage/app/Department/Thumbnail/sample.png', '0000-00-00 00:00:00', '0000-00-00 00:00:00');
